import './ProfileDropdown.css'

import {useContext} from 'react'
import {UserContext} from '../../../shared/provider/UserProvider'

export const logout = () => {
    setAuthUser('')
}



export const ProfileDropdown = () => {
    return (
        <div>
               <div className='profileDropdown'>
                <span>Alt 1</span>
                <span>Alt 2</span>
                <span>Alt 3</span>
                <span onCLick={()=>logout()}>Logga ut</span>
            </div>
        </div>
    )
}

